import { BrowserRouter as Router, useParams } from "react-router-dom";

export default function MacbookAir() {
  let { id } = useParams();

  return (
    <div>
      <video
        src=""
        width="100%"
        autoplay="autoplay"
      >
      <source src="video/supercoolvideo.mp4" type="video/mp4" />
      </video>
      <h1>Macbook Air</h1>
    </div>
  );
}
